	<h2>非你莫属</h2>
	<div class="fn">
		<h1>海归求职者被张绍刚质疑学历 当场昏厥</h1>
		<p><a href="#">我要评论(466)</a> | <a href="#">分享到空间</a> | <a href="#">转播此图到微博</a> </p>
		<a href="#"><img src="{{url('resources/views/special/fnmos/1.jpg')}}"></a>
		<p>2012年5月20日，天津卫视求职节目《非你莫属》中，一个山西的海归求职者登台参加应聘，结果被主持人张绍刚和嘉宾文怡现场质疑学历后晕倒。当晚，出场的是2号求职者郭杰，一出场外表的整齐与帅气便引全场尖叫。一开场介绍自己就说在法国留学10年之久，并拿到了国际贸易硕士、社会学本科、导演本科三个证书，这让大家都很感兴趣。</p>
		<a href="#"><img src="{{url('resources/views/special/fnmos/2.jpg')}}"></a>
		<p>张绍刚让女boss与其进行法语交流，可是郭杰则露出了马脚，让boss很疑惑那10年时间是否有在学法语。之后一系列提问他都未能回答出，结果让大家都觉得是在撒谎。就连那三张带来的证书经过boss审核也就是个中专毕业资格证。
没想到他突然晕倒在地，让一旁的张绍刚很是意外立马说一句：“你是装的吧？”</p>
		<a href="#"><img src="{{url('resources/views/special/fnmos/3.jpg')}}"></a>
		<p>郭杰在后台解释说自己确实是晕了一下，因为感受到“在场的压力”，觉得“崩了”，是“特别大的打击”。而张绍刚则随后在节目中断言“演的成分更大”，并评论“用无知出了位后，大家会喜欢你吗？”图为节目现场。嘉宾看到这一幕。最后结果让boss们都吓了一跳，全体灭灯，第一轮就被淘汰。</p>
