	<h2>泼水节</h2>
	<div class="psj">
		<div></div>
		<h2>泼水节 让我在傣家撒点野</h2>
		<p>泼水节，一个让人心旌摇荡的节日，在这个鸟语花香的季节里悄然而至。对于生活在澜沧江、瑞丽江畔的傣族同胞来说，“泼水节”这三个湿漉漉的字眼，预示着一个欢乐的、隆重的传统节日。在这万物争春的佳节里，傣族男女老少都会穿上节日的盛装赶大“摆”，举行浴佛和互相泼水祝福。随着优美的傣族音乐翩翩起舞，成千上万的人边跳边呼喊“水！水！水！”喊声动地，鼓锣之声响彻云霄，场面十分壮观。 </p>
		<p>水量开始变得越来越大了，先由掸变扬，继而由扬变泼，最后干脆脸盆、水桶、水枪一起上阵，一个劲的狂泼、猛灌，教你真正领教到什么是倾盆大雨，什么是落汤鸡。</p><br>
		<p>此时此刻，尽管大多数人都已浑身湿透，但是没有人会临阵脱逃，因为人人都明白，水就是希望，水就是祝福，于是都在心里默默祈祷：让水来得更猛烈些吧！最后每个人都成了“水做的人”，每根头发上都挂着晶莹的水滴，每个毛孔里都洋溢着甜美的幸福。 </p><br>
		<p>泼水节期间，傣族青年还会到林间空地丢荷包做游戏。彩绣的荷包内装着棉纸、棉籽等，四角和中心缀以五条花穗，是爱情的信物。小卜哨、小卜冒们先是无目的地抛来掷去，然后渐渐有了固定的目标，等小卜哨有意识的让小卜冒接不着输了以后，小卜冒便将准备好的礼物送给小卜哨。</p>
	</div>

