			<span>文 / 茉莉熏香 </span>
			<p class="pcolor">我们相识在那一个秋天，</p>
			<p class="pcolor">落叶飞了满地满天。</p>
			<p class="pcolor">你说我象是你的灰姑娘， </p> 
			<p class="pcolor">落叶映红了我的脸。</p>
			<br>
			<p class="pcolor">我们相恋在那一个秋天,</p>
			<p class="pcolor">落叶飞了满地满天。</p>
			<p class="pcolor">飘落在我的长发你的肩,</p>
			<p class="pcolor">我们孩子般<快乐</p>
